INSERT INTO `inspect_inform` VALUES ('1', '56687822', '186', '5', '举报1', '被举报人', '举报 : 7月15日，中央政法委秘书长、全国扫黑办主任陈一新主持召开全国扫黑办第七次主任会议，听取扫黑办主任、副主任分别带队的调研组“蹲一省联一片”的调研情况汇报，谋划下半年扫黑除恶任务和举措。他强调，要深入贯彻落实以习近平同志为核心的党中央决策部署，把握扫黑除恶阶段性新形势新任务，坚持以“破案攻坚”开路、以“打伞破网”断根、以“打财断血”绝后、以“问题整改”提质，推动下半年“深挖根治”取得更大成效。', 'http://localhost:8080/inspect/appeal/12345678/nav_c1.png,http://localhost:8080/inspect/appeal/12345678/nav_c2.png,http://localhost:8080/inspect/appeal/12345678/nav_c3.png,http://localhost:8080/inspect/appeal/12345678/nav_c4.png', '127.0.0.1', '1', '2', '1562942196', '1');
