INSERT INTO `inspect_sue` VALUES ('1', '53276872', '186', '8', '控告1', '被控告人', '控告:苏德良指出，当前第一批“不忘初心、牢记使命”主题教育正在深入开展，各级检察机关要深刻认识此次主题教育的重大意义，坚持问题导向，坚持求真务实，找到有效抓手，真正解决一批制约检察工作深入发展的深层次问题，确保主题教育见到实效，不断提升检察人员践行“两个维护”的定力和能力。要坚持稳中求进，力戒形式主义、官僚主义，更加务实扎实，遵循检察工作内在规律，做应做之事，做有效之事，精准发力，推动新时代检察工作高质量发展。要坚持以人民为中心，立足检察职能，提高检察工作便民利民水平，努力提供更高质量的检察产品和法治产品。', 'http://localhost:8080/inspect/appeal/12345678/nav_c1.png,http://localhost:8080/inspect/appeal/12345678/nav_c2.png,http://localhost:8080/inspect/appeal/12345678/nav_c3.png,http://localhost:8080/inspect/appeal/12345678/nav_c4.png', '127.0.0.1', '6', '1', '1562881385', '1');
