INSERT INTO `news` VALUES ('1', '四个到位 习近平对主题教育提出了新要求', '习近平强调，各地区各部门要注意抓\"四个到位\":思想认识到位、检视问题到位、整改落实到位、组织领导到位。', '3', '4', 'Boom', '1', '0');
INSERT INTO `news` VALUES ('2', '李克强电贺冯德莱恩当选欧盟委员会主席', '国务院总理李克强18日致电乌尔苏拉·冯德莱恩，祝贺她当选新一届欧盟委员会主席。', '0', '0', 'Boom', '2', '0');
