INSERT INTO `news` VALUES ('4', '习近平内蒙古考察调研精彩瞬间全记录', '7月15日至16日，中共中央总书记、国家主席、中央军委主席习近平在内蒙古考察并指导开展“不忘初心、牢记使命”主题教育。15日，习近平在赤峰市松山区兴安街道', '0', '0', 'Boom', '1', '0');
INSERT INTO `news` VALUES ('5', '杭州留泗路边的行道树怎么上了“紧箍咒”？高温天来了，葱葱茏茏的行道树算得上是行人最大的遮阳伞了，匆忙赶路时往树荫下一走，顿时解暑不少。不过最近，通过留泗路来往叶埠桥和龙坞九街的市民却发现，他们的“遮阳伞”受伤了。家住杭州西湖区转塘街道叶埠桥社区的孙先生很气愤，留泗路散步时，路边的行道树给他遮了不少阴，但是最近行道树看起来不太对劲，仔细一看才知道，竟然是树木支撑架的铁丝勒进了树皮里。“树是会长大的，好好的树看着也不会倒，为什么要勒这么紧，看着都难受。”好好的行道树 谁给上了紧箍咒呢？声明：转载此文是出于传递更多信息之目的。若有来源标注错误或侵犯了您的合法权益，请作者持权属证明与本网联系，我们将及时更正、删除，谢谢。\r\n杭州留泗路边的行道树怎么上了“紧箍咒”？', '高温天来了，葱葱茏茏的行道树算得上是行人最大的遮阳伞了，匆忙赶路时往树荫下一走，顿时解暑不少。不过最近，通过留泗路来往叶埠桥和龙坞九街的市民却发现，他们的“遮阳伞”受伤了。家住杭州西湖区转塘街道叶埠桥社区的孙先生很气愤，留泗路散步时，路边的行道树给他遮了不少阴，但是最近行道树看起来不太对劲，仔细一看才知道，竟然是树木支撑架的铁丝勒进了树皮里。“树是会长大的，好好的树看着也不会倒，为什么要勒这么紧，看着都难受。”好好的行道树 谁给上了紧箍咒呢？声明：转载此文是出于传递更多信息之目的。若有来源标注错误或侵犯了您的合法权益，请作者持权属证明与本网联系，我们将及时更正、删除，谢谢。', '0', '0', 'Boom', '1', '0');
