DROP TABLE IF EXISTS `inspect_appeal`;
CREATE TABLE `inspect_appeal` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '申诉内容id',
  `receipt` int(11) NOT NULL DEFAULT '0' COMMENT '回执单号，生成8位唯一标识符(纯数字)',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `type_id` int(11) NOT NULL DEFAULT '0' COMMENT '申诉的类型',
  `title` varchar(500) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '申诉内容标题',
  `relation_number` varchar(200) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '申诉关联单号',
  `detail` varchar(8000) NOT NULL DEFAULT '' COMMENT '申诉的详细内容',
  `proof` varchar(8000) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '证明材料（存储图片的地址）',
  `ip` varchar(100) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '数据创建时的ip',
  `admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '后台工作人员id',
  `process_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '后台工作人员处理状态，1:已提交，2：已受理，3：已完结',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间，时间戳格式',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:数据正常，2：异常',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=377 DEFAULT CHARSET=utf8mb4 COMMENT='军检申诉的具体内容';

